import React from 'react';
import "./Navbar.css"; // Import your CSS file

const Navbar = () => {
  return (
    <div id="appleNav">
      <ul>
        {/* Projects */}
        <li>
          <a href="#projects">
            Projects
            <div className="gloss-layer"></div>
          </a>
        </li>

        {/* Garage */}
        <li>
          <a href="#garage">
            <p>Garage</p>
            <div className="gloss-layer"></div>
          </a>
        </li>

        {/* Contact */}
        <li>
          <a href="#contact">
            Contact
            <div className="gloss-layer"></div>
          </a>
        </li>
      </ul>
    </div>
  );
};

export default Navbar;
